🔹хорошие возможности для заработка;
🔹оговаривается фикс + % от каждого проекта. Или только проектная оплата для некоторых специалистов;
🔹серьёзный рост;
🔹возможность работать с интересными проектами и людьми;
🔹если вы профессионал и умете делать результат - вы будет работать с большими и серьёзными проектами;
🔹в офисе полный рабочий день с 9 до 18, 5-ти дневная рабочая неделя;
🔹работа совместно со специалистом с большим стажем, вас будут курировать и направлять, если требуется;
🔹можем рассмотреть и человека без опыта, но со знаниями, если есть огромное желание учиться и работать;
